I think you can use `DataFrame` instead of `JavaRDD` to make your code more readable and easier to maintain. Here is a sample code:

```
import org.apache.spark.sql.SparkSession;
import org.apache.spark.sql.functions.*;

public class CacheHitRate {
    public static void main(String[] args) {
        SparkSession spark = SparkSession.builder()
                .appName("CacheHitRate")
                .master("local[*]")
                .getOrCreate();

        // Load your data
        Dataset<Row> onsiteAttributedData = spark.read().parquet("path/to/your/data");
        Dataset<Row> topFrequentQueries = spark.read().parquet("path/to/your/topFrequentQueries");

        // Join onsiteAttributedData with topFrequentQueries on query field
        Dataset<Row> joinedData = onsiteAttributedData.join(topFrequentQueries, onsiteAttributedData.col("query").equalTo(topFrequentQueries.col("query")));

        // Calculate cache hit rate
        Dataset<Row> hitRate = joinedData
                .withColumn("hit", when(col("query").isin(collect_set(col("query")).over(partitionBy("query"))), 1).otherwise(0))
                .agg(sum("hit").as("hit"), count("*").as("total"))
                .withColumn("hitRate", col("hit") / col("total"));

        // Show the result
        hitRate.show();
    }
}
```

This code will calculate the cache hit rate for each query in your onsiteAttributedData. If you want to calculate the overall cache hit rate, you can remove the `partitionBy("query")` in the `collect_set` function.

